import React, { useState } from 'react';


function ChatCard(props) {
    const Absent = require('../../weatherIcon/Absent.svg')
    const high = require('../../weatherIcon/high.svg')
    const moderate = require('../../weatherIcon/moderate.svg')
    const veryhigh = require('../../weatherIcon/veryhigh.svg')
    const low = require('../../weatherIcon/low.svg')

        let imagedisplay = (
            <img src={low} alt=""/>
        ) 
        const weatherdata = props.data.icon_B17
        if( weatherdata == "veryhigh"){
            imagedisplay = (<img src={veryhigh} alt="Absent"/>)
        }else if(weatherdata == "Absent"){
            imagedisplay = (<img src={Absent} alt="Absent"/>)
        }else if(weatherdata == "low"){
            imagedisplay = (<img src={low} alt="low"/>)
        }else if(weatherdata == "high"){
            imagedisplay = (<img src={high} alt="high"/>)
        }else if(weatherdata == "moderate"){
            imagedisplay = (<img src={moderate} alt="moderate"/>)
        }


    return (
        <div className="col-md-2">
            {imagedisplay}
            <p>Max Temp : {props.data.TEMPMAX_fcast_B17}</p>
            <p>Min Temp : {props.data.TEMPMIN_fcast_B17}</p>
            <p>Precipitation : {props.data.fcast_class_B17}</p>
            <p>Rain: {props.data.rained_B17_yN}</p>
        </div>
    )
}

export default ChatCard;
